import dayStyles from "./dayStyles.js";
import {
  React,
  theme,
  calendarStyles,
  moment,
  ThemeProvider,
  Button,
} from "./index.js";

const DayButton = (day) => {
  const classes = calendarStyles();

  const date = parseInt(day.day);
  console.log(new Date().getDate(), date);

  return (
    <div>
      <ThemeProvider theme={theme}>
        <Button
          className={
            dayStyles(date) == "before"
              ? calendarStyles.beforeDayButton
              : dayStyles(date) == "today"
              ? calendarStyles.todayDayButton
              : calendarStyles.afterDayButton
          }
        >
          {day.day}
        </Button>
      </ThemeProvider>
    </div>
  );
};

export default DayButton;
